
exports.seed = function(knex, Promise) {
  // Deletes ALL existing entries
  return knex('images').del()
    .then(function () {
      return Promise.all([
        // Inserts seed entries
        knex('images').insert({id: 1, url: 'data:image/png;base64,'}),
        knex('images').insert({id: 2, url: 'data:image/png;base64,'}),
        knex('images').insert({id: 3, url: 'data:image/png;base64,'})
      ]);
    });
};
